function bubbleSort(b,d){let len=b.length;for(let i=0;i<len;i++){for(let j=0;j<len-1-i;j++){if(b[j][d]<b[j+1][d]){let temp=b[j+1];b[j+1]=b[j];b[j]=temp}}}return b}function removeItem(b,d){let a=[],c=JSON.parse(JSON.stringify(b));c.forEach(function(e){d.every(function(f){if(f!==e.id){a.push(e);return false}return true})});return a};